import React from "react";

function Grid() {
    return (
        <div className="game-grid-wrapper">
            <div className="game-grid">
                {Array.from({ length: 6}, (row, index) => (
                    <Row key={index} />
                ))}
            </div>
        </div>
    )
}

function Row() {
    return (
        <div className="game-grid-row">
            {Array.from({ length: 5 }, (tile, index) => (
                <Tile key={index}/>
            ))}
        </div>
    )
}
function Tile() {
    return (
        <div className="game-tile">
            <div className="game-tile-inner" data-state="empty" data-visible="true">M</div>
            <div className="game-tile-inner" data-state="empty" data-visible="false"></div>
        </div>
    )
}




export default function GridContainer() {
    return <Grid />
}
